import React from 'react';
import { Button, Linking, RefreshControl, ScrollView, StyleSheet, Text, View } from 'react-native';
import { useState } from 'react';

const Home = (props)=>{
  console.warn(props)
  return(
    <View>

      <Text style={{fontSize:40}} >
      HEllo 
      </Text>


    </View>
  )
}

export default Home;
